import styled from 'styled-components';

export const NewItemCard = ({ item }) => {
  return (
    <ItemCard>
      <ItemImageLink to="/ItemDetail" src={item.image} alt={item.name} />
      <h3>{item.name}</h3>
      <p>{item.price}</p>
    </ItemCard>
  );
};

const ItemCardLink = styled.div`
  border: 1px solid #a9a9a9;
  margin: 16px;
  width: 200px;
  height: 300px;
  border-radius: 10px;
  justify-content: space-between;
  background-color: #ffffff;
`;
const ItemImage = styled.img`
  width: 100%;
  height: 200px;
  border-radius: 10px 10px 0 0;
  object-fit: cover;
`;
